-- ------------------------------------------------
-- Version: v1.30
--
-- Description: Migration that introduces the provider authority relation
-- -------------------------------------------------

CREATE TABLE k_Provider_Authority (
    ID_PRV_AUT integer,
    lod_PRV character varying(255) NOT NULL,
    lodRelation character varying(255),
    lodAUT character varying(255),
    ID_PRV_AUT_V integer,
    populatedBy character varying(255),
    lastTouch character varying(255),
    PRIMARY KEY (lod_PRV, lodAUT),
    FOREIGN KEY (lod_PRV) REFERENCES k_Provider(lodPRV) ON DELETE CASCADE,
    FOREIGN KEY (lodAUT) REFERENCES k_Authority(lodAUT) ON DELETE CASCADE
);



